import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { generateWebsite } from '../../services/api';
import Loading from '../common/Loading';

const GenerateWebsite = () => {
  const [formData, setFormData] = useState({
    websiteType: '',
    additionalRequirements: ''
  });
  const [websiteContent, setWebsiteContent] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const navigate = useNavigate();

  const { websiteType, additionalRequirements } = formData;

  const websiteTypes = [
    'Business/Corporate',
    'E-commerce',
    'Portfolio',
    'Blog',
    'Landing Page',
    'Service-based',
    'Informational',
    'Membership'
  ];

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setLoading(true);

    try {
      const data = await generateWebsite(formData);
      setWebsiteContent(data.websiteContent);
    } catch (error) {
      setError('Failed to generate website content');
      console.error(error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="container">
        <Loading message="Generating your website content. This may take a minute..." />
      </div>
    );
  }

  return (
    <div className="container">
      <div className="service-header">
        <h1>Generate Website</h1>
        <p>Create a professional website with AI-generated content tailored to your business</p>
      </div>

      {error && <div className="error-message">{error}</div>}

      {!websiteContent ? (
        <div className="card">
          <form onSubmit={handleSubmit}>
            <div className="form-group">
              <label htmlFor="websiteType">Website Type</label>
              <select
                id="websiteType"
                name="websiteType"
                value={websiteType}
                onChange={handleChange}
                required
              >
                <option value="">Select a website type</option>
                {websiteTypes.map((type) => (
                  <option key={type} value={type}>{type}</option>
                ))}
              </select>
            </div>

            <div className="form-group">
              <label htmlFor="additionalRequirements">Additional Requirements</label>
              <textarea
                id="additionalRequirements"
                name="additionalRequirements"
                value={additionalRequirements}
                onChange={handleChange}
                rows={4}
                placeholder="Describe any specific requirements or features you want for your website"
              />
            </div>

            <button type="submit" className="btn btn-primary">
              Generate Website Content
            </button>
          </form>
        </div>
      ) : (
        <div className="result-card">
          <h2>Your Website Content</h2>
          <div className="content-box">
            <pre>{websiteContent}</pre>
          </div>
          <div className="action-buttons">
            <button
              onClick={() => {
                navigator.clipboard.writeText(websiteContent);
                alert('Content copied to clipboard!');
              }}
              className="btn btn-secondary"
            >
              Copy to Clipboard
            </button>
            <button
              onClick={() => setWebsiteContent(null)}
              className="btn btn-secondary"
            >
              Generate Another
            </button>
            <button
              onClick={() => navigate('/dashboard')}
              className="btn btn-primary"
            >
              Back to Dashboard
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default GenerateWebsite;
